INSERT INTO `xy_index_msg` VALUES (1, '平台公告（中）', 'Platform announcement', 'ประกาศแพลตฟอร์ม', '<p>Dear member:<br />\r\nWelcome to join Womart. Important note: If your bank account is successfully deducted when recharging, but the amount of your order prepayment account has not increased, please do not recharge and contact your superior agent as soon as possible. In Womart, your income will depend on your investment. I wish you an early realization of your wealth dream!</p>', '<p>12121</p>', '<p>456</p>', 3, 1613534933, 1, 'admin');
INSERT INTO `xy_index_msg` VALUES (2, '平台简介（中）', 'Introduction of platform', 'การแนะนำแพลตฟอร์ม', '<p>平台简介</p>', '<p><strong><span style=\"font-size:18px;\">Dear member:</span></strong><br />\r\n<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Welcome to </span><span style=\"font-size:18px;\"><strong>WomatAPP.</strong></span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">What is Womat?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>Womat</strong> is a third-party smart matching online ordering platform. The main partners of the platform include Flipkart, Amazon, eBay and other online shopping platform merchants. The platform matches merchant orders to platform users through an intelligent system, thereby increasing the sales volume and reputation of major merchants on the main platform. This platform orders more than one million orders every day. It is an integral part of Flipkart and Amazon.</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">How does Womat guide us to make money?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>The Womat </strong>platform automatically matches each user&#39;s product orders from Flipkart, Amazon, eBay and other platforms through the intelligent system. Each Womat member only needs to complete these matching orders on the platform to get the corresponding commission. ；</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">How profitable are Womat members?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>Womat</strong> promises to each member that the monthly profit of all members is at least 45% of the principal; Womart will make up the shortfall for you;</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">Is my money in Womat safe?</span></strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>Womat</strong> is a world-renowned online ordering system. Have the most advanced bank insurance system. Every Womat user will receive an insurance limit of up to US$3 million from Prudential Insurance Company. Every day the user&#39;s funds will be transferred to the bank account bound to the platform. The bank will also provide Womart users with maximum insurance fund protection.</span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">Honor of Womat platform</span></strong></span><br />\r\n<span style=\"font-size:16px;\">Won the best partner and most important partner of Amazon and Flipkart from 2018 to 2019;<br />\r\nIn 2020, get the favorite cooperation platform and most important partner of Amazon and Flipkart merchants; Flipkart invested 10 million US dollars in Womat;</span></p>', '<p>.</p>', 3, 1641229941, 1, 'admin');
INSERT INTO `xy_index_msg` VALUES (3, '规则说明（中）', 'Rule description', 'คำอธิบายกฎ', '<p class=\"p\" style=\"text-align:left; margin-top:7px; margin-bottom:7px\">规则说明规则说明规则说明规则说明</p>', '', '<p>คำอธิบายกฎคำอธิบายกฎคำอธิบายกฎ</p>', 3, 1616071291, 1, 'admin');
INSERT INTO `xy_index_msg` VALUES (4, '公司简介（中）', 'Company profile', 'ประวัติ บริษัท', '<p>公司简介公司简介公司简介公司简介</p>', '<p><span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">Platform agent mode1</span></strong></span><br />\r\n<span style=\"font-size:16px;\">The Womart platform adopts the world&#39;s most advanced and user-friendly agency model, that is, any Womart member does not need to apply and can become an agent of the Womart platform for free;</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">How to become an agent of Womart platform</span></strong></span><br />\r\n<span style=\"font-size:16px;\">Womart has prepared an exclusive agent link for each member (invite friends on its platform); members only need to send their own exclusive link to others, as long as he successfully registers and recharges, you can become an agent of the Womart platform; Enjoy the treatment of an agent;</span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">What are the benefits of becoming a Womart platform agent?</span></strong></span><br />\r\n<span style=\"font-size:16px;\">If you become an agent of the Womart platform, you will enjoy:<br />\r\n10% commission of the total amount of the first-level downline recharge; this benefit is valid for a long time;<br />\r\nThe first-level downline day earns 16% of the total commission amount; this benefit is valid for a long time;<br />\r\nEarn 8% of the total commission amount on the second-level downline day; this benefit is valid for a long time;<br />\r\nThe third-level downline earns 4% of the total commission amount; this benefit is valid for a long time;</span><br />\r\n<span style=\"font-size:18px;\"><strong>Remarks:</strong></span><br />\r\n<span style=\"font-size:16px;\"><strong>The first-level downline is</strong>: people who become Womart members through your exclusive invitation link;<br />\r\n<strong>The second-level downline is</strong>: the person who becomes a Womart member through the exclusive invitation link for the first-level downline;<br />\r\n<strong>The third-level downline is</strong>: the person who becomes a Womart member through the exclusive invitation link of the second-level downline;</span><br />\r\n<span style=\"font-size:18px;\"><strong><span style=\"background-color:#e74c3c;\">What is the current income situation of Womart agents?</span></strong></span><br />\r\n<span style=\"font-size:16px;\">&nbsp; We have calculated the income of 1327 ordinary agents on the Womart platform; 30% of them earn more than 8,000 rupees a day; 50% earn more than 20,000 rupees a day; 20% earn more than 100,000 rupees a day;<br />\r\nBecoming an agent of the Womart platform and giving yourself a chance to become a rich man is the wisest choice of your life. Now let&#39;s act quickly!</span></p>', '<p>ประวัติ บริษัทประวัติ บริษัทประวัติ บริษัทประวัติ บริษัท</p>', 3, 1613536578, 1, 'admin');
