INSERT INTO `xy_index_msg` VALUES (6, '新手指南', 'Newbie guide', 'คู่มือมือใหม่', '<p>详情可查看客服栏说明，订单发货冻结时间为30分钟，充值提现问题可咨询客服24小时在线，云淘商贸有限公司祝大家新年快乐</p>', '<p>details can be seen in the customer service bar description, order delivery freeze time is 30 minutes, recharge and withdrawal questions can consult customer service 24 hours online, yuntao trading co., LTD wish you a happy New Year</p>', '<p>ฝ่ายบริการลูกค้ารายละเอียดสามารถตรวจสอบรายละเอียดเพิ่มเติมได้ใน 30 นาทีการจัดส่งสินค้าสามารถให้คำปรึกษากับฝ่ายบริการลูกค้าได้ภายใน 24 ชั่วโมงออนไลน์สำหรับการบริการลูกค้าออนไลน์สำหรับผู้ซื้อ ที่มี จำกัด เมนูสุขสันต์วันปีใหม่</p>', 1, 1613486334, 1, 'admin');
INSERT INTO `xy_index_msg` VALUES (7, '利息宝规则', 'Home page rolling content', 'ดอกเบี้ยกฏโบราณ', '<p>Dear member hello</p>\r\n\r\n<p>Our financial products are calculated on a daily basis, and settlement is completed within 24 hours. The number of financial management days is divided into (7 days, 15 days, 30 days, and 60 days). If the number of days is different each time, the interest will be different. , You can withdraw cash at any time. If there is no full 24 hours on that day, no interest will be calculated on that day. The deposited funds can be withdrawn to participate in the order grab when the financial management days of the purchase of wealth management products are over 24 hours, and if the funds are deposited, it will not affect your funds. If you want to know more, you can consult the online customer service to solve it for you.</p>', '', '', 1, 1611742761, 0, 'admin');
INSERT INTO `xy_index_msg` VALUES (8, '首页滚动内容（中）', 'Home page rolling content', 'เลื่อนเนื้อหาไปหน้าแรก', '<p>歡迎您來到第三方商家聯盟智能在線訂購平台，平台提示您注意個人賬戶資金安全，有疑問請諮詢平台操作員或平台客服。</p>', '<p>Welcome to the third-party merchant alliance intelligent online ordering platform. The platform reminds you to pay attention to the safety of personal account funds. If you have any questions, please consult the platform operator or platform customer service.</p>', '<p>ยินดีต้อนรับสู่แพลตฟอร์มการสั่งซื้อออนไลน์อัจฉริยะของพันธมิตรผู้ค้าบุคคลที่สาม แพลตฟอร์มเตือนให้คุณใส่ใจกับความปลอดภัยของเงินในบัญชีส่วนบุคคล หากคุณมีคำถามใด ๆ โปรดปรึกษาผู้ให้บริการแพลตฟอร์มหรือฝ่ายบริการลูกค้าของแพลตฟอร์ม</p>', 1, 1640875958, 0, 'admin');
INSERT INTO `xy_index_msg` VALUES (9, '抢单备注', 'Grab a single note', 'หมายเหตุ', '<p>When the platform matches the order to the user, the platform submits the information of the order to the merchant backend. If the user does not submit the order within two minutes, the order will be frozen in order to avoid the supervision of the online shopping platform. After the order is frozen, the funds of the order will also be frozen. You need to wait for the system to unfreeze it after 24 hours. Please be aware of this. Hierarchical VIP mode (such as: the maximum daily commission within 10,000 on the account is 3%, the maximum commission for 1,0001--50000 is 3.5%, and the maximum daily commission for 50001--100000 is 4%)</p>', '', '', 1, 1611742097, 0, 'admin');
INSERT INTO `xy_index_msg` VALUES (11, '首页弹窗内容（中）', 'Home page pops up', 'หน้าแรกจะปรากฏขึ้น', '<pre data-placeholder=\"翻译\" dir=\"ltr\" id=\"tw-target-text\">\r\n<strong>谨防上当，请勿私下交易，\r\n任何充值和体现业务请联系客服</strong></pre>', '<p><span style=\"font-size: 20px;\"><b>Beware of being deceived, do not trade privately,</b></span></p>\r\n\r\n<p><span style=\"font-size: 20px;\"><b>please contact customer service for any recharge and business performance</b></span></p>', '<p><strong>ระวังโดนหลอก ห้ามซื้อขายแบบส่วนตัว โปรดติดต่อฝ่ายบริการลูกค้าสำหรับการเติมเงินและผลการดำเนินธุรกิจ</strong></p>', 1, 1641215803, 0, 'admin');
INSERT INTO `xy_index_msg` VALUES (12, '公司资质', 'Company qualification', 'คุณสมบัติของ บริษัท', '<p>公司资质公司资质公司资质</p>', '<p>Dear user hello In order to protect the company&#39;s privacy, the company&#39;s qualifications are inconvenient to announce; please contact our customer service center to obtain!</p>', '<p>คุณสมบัติของ บริษัทคุณสมบัติของ บริษัทคุณสมบัติของ บริษัท</p>', 1, 1613536626, 0, 'admin');
