INSERT INTO `xy_index_msg` VALUES (377, 'プラットフォームの概要', 'Platform announcement', 'ประกาศแพลตฟอร์ม', '<p>親愛なるメンバー：<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ユーラシアアプリへようこそ。<br />\r\nユーラシアとは何ですか？<br />\r\nユーラシアは、スマートマッチングのためのサードパーティのオンライン注文プラットフォームです。プラットフォームの主なパートナーには、Zホールディングス、アマゾン、eBay、その他のオンラインショッピングプラットフォームの加盟店が含まれます。プラットフォームは、インテリジェントシステムを介してマーチャントの注文をプラットフォームユーザーと照合し、それによってメインプラットフォームでの主要なマーチャントの販売量と評判を高めます。プラットフォームは毎日100万以上の注文を注文します。これは、Zホールディングスとアマゾンの不可欠な部分です。<br />\r\nユーラシアはどのように私たちをお金を稼ぐために導きますか？<br />\r\nユーラシアのプラットフォームは、インテリジェントシステムを通じて、Zホールディングス、アマゾン、eBay、その他のプラットフォームからの各ユーザーの製品注文を自動的に照合します。各ユーラシアのメンバーは、対応するコミッションを取得するために、プラットフォーム上でこれらの一致する注文を完了する必要があるだけです。 ；<br />\r\nユーラシアのメンバーの収益性はどのくらいですか？<br />\r\nユーラシア人は、すべてのメンバーの月間利益が元本の少なくとも45％に達する必要があることを各メンバーに約束します。ユーラシア人は、あなたの欠点を補います。<br />\r\nユーラシアでの私のお金は安全ですか？<br />\r\nユーラシアは世界的に有名なオンライン注文システムです。最先端のバンカシュアランスシステムを所有しています。ユーラシアの各ユーザーは、プルデンシャル保険会社から最大300万米ドルの保険限度額を受け取ります。ユーザーの資金は、プラットフォームにバインドされた銀行口座に毎日送金されます。この銀行はまた、ヨーロッパとアジアのユーザーに最高度の保険基金保護を提供します。<br />\r\nユーラシアのプラットフォームの栄誉<br />\r\n2018年から2019年にかけて、AmazonとZホールディングスの最高のパートナーおよび最も重要なパートナーを獲得しました。<br />\r\n2020年には、AmazonとZホールディングスの加盟店のお気に入りの協力プラットフォームおよび最も重要なパートナーになります。Zホールディングスはユーラシアに1​​,000万米ドルを投資しています。</p>', '<p>親愛なるメンバー：<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ユーラシアアプリへようこそ。<br />\r\nユーラシアとは何ですか？<br />\r\nユーラシアは、スマートマッチングのためのサードパーティのオンライン注文プラットフォームです。プラットフォームの主なパートナーには、Zホールディングス、アマゾン、eBay、その他のオンラインショッピングプラットフォームの加盟店が含まれます。プラットフォームは、インテリジェントシステムを介してマーチャントの注文をプラットフォームユーザーと照合し、それによってメインプラットフォームでの主要なマーチャントの販売量と評判を高めます。プラットフォームは毎日100万以上の注文を注文します。これは、Zホールディングスとアマゾンの不可欠な部分です。<br />\r\nユーラシアはどのように私たちをお金を稼ぐために導きますか？<br />\r\nユーラシアのプラットフォームは、インテリジェントシステムを通じて、Zホールディングス、アマゾン、eBay、その他のプラットフォームからの各ユーザーの製品注文を自動的に照合します。各ユーラシアのメンバーは、対応するコミッションを取得するために、プラットフォーム上でこれらの一致する注文を完了する必要があるだけです。 ；<br />\r\nユーラシアのメンバーの収益性はどのくらいですか？<br />\r\nユーラシア人は、すべてのメンバーの月間利益が元本の少なくとも45％に達する必要があることを各メンバーに約束します。ユーラシア人は、あなたの欠点を補います。<br />\r\nユーラシアでの私のお金は安全ですか？<br />\r\nユーラシアは世界的に有名なオンライン注文システムです。