-- ----------------------------
-- Table structure for xy_reward_log
-- ----------------------------
DROP TABLE IF EXISTS `xy_reward_log`;
CREATE TABLE `xy_reward_log`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `oid` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '订单号',
  `uid` int unsigned NOT NULL COMMENT '产生交易用户',
  `sid` int unsigned NOT NULL COMMENT '交易对象',
  `num` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '交易数额',
  `lv` int unsigned NOT NULL COMMENT '级差',
  `type` int(0) NOT NULL DEFAULT 0 COMMENT '订单类型 1充值订单(推广返佣) 2交易订单(交易返佣)',
  `status` int(0) NOT NULL DEFAULT 0 COMMENT '佣金发放状态 0自动发放 1未发放 2已发放',
  `addtime` int unsigned NOT NULL COMMENT '创建时间',
  `endtime` int unsigned NOT NULL COMMENT '处理时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `oid`(`oid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2812 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '订单佣金发放记录表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of xy_reward_log
-- ----------------------------

-- ----------------------------
-- Table structure for xy_script
-- ----------------------------
DROP TABLE IF EXISTS `xy_script`;
CREATE TABLE `xy_script`  (
  `script` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '代码块',
  `id` int(0) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for xy_shop_goods_cate
-- ----------------------------
DROP TABLE IF EXISTS `xy_shop_goods_cate`;
CREATE TABLE `xy_shop_goods_cate`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商店名称',
  `bili` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商品名称',
  `cate_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '商品描述',
  `goods_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '商品价格',
  `cate_pic` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '商品展示图片',
  `addtime` int(0) NOT NULL COMMENT '添加时间',
  `status` int(0) NULL DEFAULT 0 COMMENT '上架状态 0不上架 1上架',
  `min` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '最小金额限制',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 167 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '商品表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of xy_shop_goods_cate
-- ----------------------------

-- ----------------------------
-- Table structure for xy_shop_goods_list
-- ----------------------------
DROP TABLE IF EXISTS `xy_shop_goods_list`;
CREATE TABLE `xy_shop_goods_list`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `shop_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商店名称',
  `goods_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商品名称',
  `goods_info` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '商品描述',
  `goods_price` decimal(10, 2) NOT NULL COMMENT '商品价格',
  `goods_pic` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '商品展示图片',
  `addtime` int(0) NOT NULL COMMENT '添加时间',
  `status` int(0) NOT NULL DEFAULT 0 COMMENT '上架状态 0不上架 1上架',
  `cid` int(0) NULL DEFAULT 1,
  `is_tj` int(0) NULL DEFAULT NULL,
  `lang` int(0) NOT NULL DEFAULT 1 COMMENT '=1表示中文商品=2英文=3泰国语=4日本语',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 643 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '商品表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of xy_shop_goods_list
-- ----------------------------

-- ----------------------------
-- Table structure for xy_shop_order
-- ----------------------------
DROP TABLE IF EXISTS `xy_shop_order`;
CREATE TABLE `xy_shop_order`  (
  `uid` int(0) NOT NULL,
  `gid` int(0) NOT NULL COMMENT '商品id',
  `addtime` int(0) NOT NULL COMMENT '添加时间',
  `price` decimal(15, 3) NULL DEFAULT NULL,
  `status` int(0) NOT NULL DEFAULT 0 COMMENT '上架状态 0不上架 1上架',
  `num` int(0) NULL DEFAULT NULL,
  `price2` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL,
  `id` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for xy_user_error
-- ----------------------------
DROP TABLE IF EXISTS `xy_user_error`;
CREATE TABLE `xy_user_error`  (
  `id` int unsigned NOT NULL,
  `uid` int(0) NOT NULL COMMENT '用户ID',
  `addtime` int(0) NOT NULL COMMENT '记录时间',
  `oid` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '交易单号',
  `type` int(0) NOT NULL DEFAULT 1 COMMENT '记录类型 1解封 2违规操作 3冻结',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `uid`(`uid`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '会员-违规操作记录表' ROW_FORMAT = Fixed;

-- ----------------------------
-- Table structure for xy_users
-- ----------------------------
DROP TABLE IF EXISTS `xy_users`;
CREATE TABLE `xy_users`  (
  `id` int unsigned NOT NULL,
  `tel` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '手机',
  `username` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '用户名',
  `nickname` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '昵称',
  `pwd` char(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '密码',
  `salt` char(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '密码盐',
  `parent_id` int unsigned NOT NULL COMMENT '上级ID',
  `signiture` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '个性签名',
  `pwd_error_num` tinyint unsigned NOT NULL COMMENT '密码错误次数',
  `allow_login_time` int unsigned NOT NULL COMMENT '允许登录时间',
  `real_name` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '真实姓名',
  `id_card_num` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '身份证号码',
  `top_pic` varchar(96) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '身份证正面图',
  `bot_pic` varchar(96) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '身份证背面图',
  `id_status` tinyint unsigned NOT NULL COMMENT '实名认证状态，0未审核，1审核通过，2审核不通过',
  `invite_code` char(6) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '邀请码',
  `addtime` int unsigned NOT NULL COMMENT '注册时间',
  `status` tinyint unsigned NOT NULL COMMENT '状态，1启用，2禁用',
  `danhao` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '卡单单号，8,9,10',
  `jine` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '卡单单价',
  `shuliang` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '卡单数量',
  `real_time` int unsigned NOT NULL COMMENT '实名时间',
  `pwd2` char(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '提现密码',
  `salt2` char(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '提现密码盐',
  `headpic` varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '头像',
  `balance` decimal(15, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '账户余额',
  `freeze_balance` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '账号冻结金额',
  `login_status` tinyint unsigned NOT NULL COMMENT '是否登录状态，1：是，0否',
  `recharge_num` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '日充值金额',
  `deposit_num` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '日提现金额',
  `deal_status` tinyint unsigned NOT NULL COMMENT '交易状态，0交易冻结，1停止交易，2等待交易，3交易中',
  `deal_error` tinyint(1) NOT NULL DEFAULT 0 COMMENT '违规次数',
  `deal_reward_count` int(0) NOT NULL DEFAULT 0 COMMENT '奖励交易次数',
  `deal_count` int(0) NOT NULL DEFAULT 0 COMMENT '当日交易次数',
  `deal_time` int unsigned NOT NULL COMMENT '最后交易日期(年月日)',
  `active` smallint unsigned NOT NULL COMMENT '激活状态，0未激活(首次充值发放推广奖励)，1已激活',
  `childs` int(0) NOT NULL DEFAULT 0 COMMENT '直推用户数量',
  `kouchu_balance` decimal(15, 2) NULL DEFAULT NULL COMMENT '扣除金额',
  `kouchu_balance_uid` int(0) NULL DEFAULT NULL,
  `show_td` int(0) NULL DEFAULT 1,
  `show_cz` int(0) NULL DEFAULT 1,
  `show_tx` int(0) NULL DEFAULT 1,
  `show_tel` int(0) NULL DEFAULT 1,
  `show_num` int(0) NULL DEFAULT 1,
  `show_tel2` int(0) NULL DEFAULT 1,
  `wx_ewm` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `zfb_ewm` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `lixibao_balance` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '利息宝金额',
  `lixibao_dj_balance` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '利息宝冻结金额',
  `ip` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `is_jia` int(0) NULL DEFAULT 0,
  `pipei_min` int unsigned NOT NULL,
  `pipei_max` int unsigned NOT NULL,
  `level_validity` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '会员有效期至',
  `cz_time` int(0) NOT NULL DEFAULT 0 COMMENT '最后充值时间，0为 没有充值',
  `tx_time` int(0) NOT NULL DEFAULT 0 COMMENT '今日提现用户，为0 没有提现',
  `s_cz_time` int(0) NOT NULL DEFAULT 0 COMMENT '今日首充用户，为0  没有充值',
  `is_order_num` int(0) NOT NULL DEFAULT 0 COMMENT '未完成任务数量',
  `level` int(0) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `tel`(`tel`) USING BTREE,
  UNIQUE INDEX `invite_code`(`invite_code`) USING BTREE,
  UNIQUE INDEX `username`(`username`) USING BTREE,
  INDEX `parent_id`(`parent_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 225 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '会员-用户表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of xy_users
-- ----------------------------

-- ----------------------------
-- Table structure for xy_verify_msg
-- ----------------------------
DROP TABLE IF EXISTS `xy_verify_msg`;
CREATE TABLE `xy_verify_msg`  (
  `tel` char(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '用户ID',
  `msg` char(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '验证码',
  `addtime` int unsigned NOT NULL COMMENT '发送时间',
  `type` tinyint(0) NOT NULL DEFAULT 0 COMMENT '类型，1注册,2修改密码，3修改二级密码',
  PRIMARY KEY (`tel`) USING BTREE,
  INDEX `type`(`type`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Fixed;

SET FOREIGN_KEY_CHECKS = 1;
